export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},VevXKJk6kq:{data:{id:360,attributes:{imdbId:"tt0309377",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTIxMDMzMDk1NV5BMl5BanBnXkFtZTYwNzgxNDY3._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"52%"},{Source:"Metacritic",Value:"64\u002F100"}],item_lang:{data:{id:1023,attributes:{title:e,plot:"Retired F.B.I. profiler Terry McCaleb (Clint Eastwood), who has recently had a heart transplant, is hired by Graciella Rivers (Wanda De Jesus), to investigate the death of her sister, Gloria, who happens to have given McCaleb his heart. On the case, he soon deduces that the killer, who staged the murder to look like a random robbery, may actually be a serial killer Terry was trailing for years in the F.B.I. Can the elderly and feeble McCaleb, who had intended to spend his retirement living on his boat in the Los Angeles harbor, and who can't drive, and has to nap regularly, muster up the endurance to find the killer?",slug:"blood-work"}}},books:{data:[{id:3246,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:true,published:j,publisher:k,subtitle:a}},{id:3247,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:d,published:j,publisher:k,subtitle:a}},{id:3248,attributes:{title:"Three Great Novels",description:"Gathered in one fantastic volume for the first time are three compelling novels.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3TedcQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2010-01-01",publisher:a,subtitle:"The Poet, Blood Work, Void Moon"}},{id:3249,attributes:{title:"The Third Rail",description:"The ferocious new novel from the author of The Chicago Way and The Fifth Floor finds Michael Harvey at the top of his game in an expertly plotted, impossible to put down thriller set in Chicago's public transit system. Harvey's tough talking, Aeschylus quoting, former Irish cop turned PI, Michael Kelly, is back in another sizzling murder mystery that pits him against a merciless sniper on the loose in Chicago's public transportation system. After witnessing a shooting on an L platform-and receiving a phone call from the killer himself-Kelly is drawn toward a murderer with an unnerving link to his own past, to a crime he witnessed as a child, and to the consequences it had on his relationship with his father, a subject Kelly would prefer to leave unexamined. But when his girlfriend-the gorgeous Chicago judge Rachel Swenson-is abducted, Kelly has no choice but to find the killer by excavating his own stormy past. Stylish, sophisticated, edge-of-your-seat suspense from a new modern master.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qC5ZntZkfPsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Michael Harvey"],firstBook:d,published:"2010-04-05",publisher:"A&C Black",subtitle:a}},{id:3250,attributes:{title:"A Darkness More Than Night",description:"Terry McCaleb, the retired FBI agent who starred in the bestseller \"Blood Work,\" is asked by the LAPD to help them investigate aseries of murders that have them baffled. They are the kind of ritualized killings McCaleb specialized in solving with the FBI, and he is reluctantly drawn from his peaceful new life back into the horror and excitement of tracking down a terrifying homicidal maniac. More horrifying still, the suspect who seems to fit the profile that McCaleb develops is someone he has known and worked with in the past: LAPD homicide detective Harry Bosch.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=horAoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2014-05-21",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309147869}}("","movie","Michael Connelly",null,"Blood Work","series",1,"From the #1 bestselling author of the Harry Bosch and the Lincoln Lawyer series and who \"is the master of the universe in which he lives\" (Huffington Post), comes the gripping novel that inspired the film starring Clint Eastwood. When Graciella Rivers steps onto his boat, ex-FBI agent Terrell McCaleb has no idea he's about to come out of retirement. He's recuperating from a heart transplant and avoiding anything stressful. But when Graciella tells him the way her sister, Gloria, was murdered, Terry realizes he has no choice. Now the man with the new heart vows to take down a predator without a soul. For Gloria's killer shatters every rule that McCaleb ever learned in his years with the Bureau-as McCaleb gets no more second chances at life...and just one shot at the truth. *Winner of the Grand Prix de Littérature Policière- International Category *Winner of the Macavity Award for Best Mystery Novel *Winner of the Anthony Award for Best Novel","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8oNlAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2003-04-29","Hachette UK"))